import React from 'react';
import './mainPage.css';
import logo from '../logo.png';

export class MainPage extends React.Component {

    // <div>
    //             <p>{this.props.usn}</p>
    //         </div>
    render() {
        return(
            <html>
                <head>
                <link href="https://fonts.googleapis.com/css?family=Montserrat&display=swap" rel="stylesheet"/>
                </head>
                <body>
                    <div>
                        <ul className="navbar">
                            <li className="navelement">About</li>
                            <li className="navelement">History</li>
                            <li className="navelement">Stats</li>
                            <li className="navelement">Home</li>
                            <li><img className="logo" src={logo} alt=""/></li>
                        </ul>
                    </div>
                    <div>
                        <div className="upload">
                            <form action="localhost:1111/api/upload" method="post" encType="multipart/form-data">
                                <input type="file" name="file"/>
                                <input type="submit" value="Upload"/>
                            </form>
                            <div>
                                <p>Your current upload:</p>
                                {/* Add image here*/}
                                <p>Total:</p>
                            </div>
                        </div>
                    </div>
                </body>
            </html>

        )
    }
}
